	/**
	 * the vanity url code for the guild
	 */
	vanity_url_code: string;
	/**
	 * the description for the guild
	 */
	description: string;
	/**
	 * The hash of the guild's banner
	 */
	banner: string;
	/**
	 * The premium tier of the guild
	 */
